import React from 'react';
import { Columns, Container, Heading } from 'react-bulma-components';
import SectionTitle from './sectionTitle';

const Footer: React.FC = () => {

  return (
    <div className='is-primary'>
      <Container className='ml-6 py-6'>
        <SectionTitle title='Contact us' color='is-text-white'/>
        <Columns>
          <Columns.Column size={'two-thirds'}>
            <Heading>
              Have a project in mind?<br />
              Let's make it happen
            </Heading>
          </Columns.Column>
          <Columns.Column size={'one-third'}>
            <Heading className='is-text-white' weight='light' size={6} subtitle>
              22 Street Name, Suburb, 8000,<br />
              Cape Town, South Africa<br />
              +27 21 431 0001<br />
              enquirie@website.co.za
            </Heading>
          </Columns.Column>
        </Columns>
      </Container>
    </div>
  )
};

export default Footer;
